import React from 'react';

const ProgressBar = (props) => {
    return (
        <div className={props.className}>
            <h3> {props.title} </h3>
            <div className="years">
                <span>Année d'expérience</span>
                <span>1 an</span>
                <span>2 ans</span>
            </div>

            <div>
                { 
                props.Languages.map((items) => {
                    let xpYears = 1;
                    let progressBar = (items.xp / xpYears) * 100;
                })
                }
            </div>
        </div>


    );
};

export default ProgressBar;
